import React from 'react';
import { Container } from '@mui/material';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

const Welcome = ({ nextStep }) => {
    return (
        console.log(nextStep),
        <Container>
            <Box sx={{ bgcolor: 'white' }}>
                <Typography variant="h2" gutterBottom>
                    In this assessment, we will ask you a series of questions to determine how well you are doing with Agile.
                </Typography>
                <Typography variant="h4" gutterBottom>
                    There are 3 steps:
                    First, we will ask you some questions about your delivery frequency.
                    <Divider>
                        Then we will ask you some questions about your business.
                    </Divider>
                    And finally, we will ask you some questions about your processes.
                </Typography>

                <Button variant="contained" color="primary" type="button" onClick={nextStep}>
                    Start the Assessment
                </Button>
            </Box>
        </Container>
    );
};
export default Welcome;
